"><h2 class="name_short">Przepiśnik Folk Interdruk</h2><h2 class="name_long">Przepiśnik Folk Interdruk</h2></a><span class="code">Kod produktu: IR6355</span><div class="details"><br/> Wzór: Folk<br/> Ilość kartek: Inna<br/> Format: Inny<br/></div></div><div class="prices clearfix"><div class="left col-xs-6"><span class="gross">27,70 zł / szt</span><br/><span class="net">22,52 zł netto</span></div><div class="right col-md-6"><span class="old">40,20 zł</span></div></div></div><div class="addToWishWrap"><button class="go gomain">do ulubionych</button></div></div><div class="descriptionInnerHover clearfix"></div></div><div class="clearfix"></div></div></div></div></section></div></main><div class="container"><div class="homeMiniBaners clearfix"><div class="baner blackpoint"><a href="/blackpoint-1-111-l"><img src="/images/blackpoint/blackpointBaner.jpg"></a></div><div class="baner parker"><a href="/parker-2-111-c"><img src="/images/parker/2x1111.jpg"></a></div></div></div><div class="articlesBottom"><div class="container"><h2 class="mainTitle">Artykuły biurowe, papiernicze, szkolne - sklep online</h2><div class="singleColBox"><h3 class="subTitle">Sklep Atakto.pl - to Twoje centrum biurowe</h3><div class="text"> Internetowy sklep z artykułami biurowymi Atakto.pl to sklep w którym znajdziesz szeroki wybór artykułów biurowych od długopisów, przez korektory, tusze, czy nawet akcesoria do archiwizacji dokumentów, aż po akcesoria takie jak papier czy mydło potrzebne w biurowych łazienkach. Niezbędne urządzenia biurowe: bindownice, laminatory oraz wiele innych, jak i drobne elementy wyposażenia biur takie jak: kosze czy zegary. Sklep z artykułami papierniczymi Atakto.pl to miejsce w którym każda księgowa czy kadrowa znajdzie niezbędne do swojej pracy druki i formularze, potrzebne do prowadzenia dokumentacji pracowników, stanów magazynowych oraz wszelakich rozliczeń. Sklep papierniczy Atakto.pl to skarbnica wszelkich akcesoriów papierniczych, zdobniczych i nie tylko, które można wykorzystywać do efektownych biurowych prezentacji lub do tworzenia niepowtarzalnych prac plastycznych, a nawet do wspólnej kreatywnej zabawy z dzieckiem, a nawet do tworzenia niezapomnianych ozdób na przyjęcia urodzinowe lub inne ważne uroczystości w gronie rodzinnym, choć nie tylko. Bo można tych akcesoriów papierniczych używać podczas zajęć w szkole, przedszkolu, czy też na jakich kółkach plastycznych. Centrum biurowe Atakto.pl sprawi, że twoje dziecko ruszy do szkoły z uśmiechem na ustach, będąc kompletnie wyposażone w artykuły szkolne począwszy od zeszytów, kredek, farb a skończywszy na piórniku czy plecaku, z wizerunkiem nawet swojego ulubionego bohatera z bajki. Nasza oferta artykułów szkolnych zawiera wszystkie elementy, które powinny się znaleźć w szkolnej wyprawce Twojego dziecka. Artykuły szkolne oraz biurowe, które znajdziesz w Atakto.pl zostały starannie dobrane, aby zaoferować Ci produkty o najlepszej jakości i wytrzymałości. Niejednokrotnie wykonane już z tworzyw otrzymanych z recyklingu. Wyposażenie biura wspólnie z Atakto.pl to czysta przyjemność, wybieraj spośród tysięcy artykułów biurowych. Gwarantujemy najlepsze ceny na artykuły szkolne, biurowe oraz wszystko co może okazać się potrzebne w codziennej pracy. Sprawdź i znajdź coś dla siebie, swojego biura lub dla swoich bliskich, bo na Atakto.pl masz duży wybór produktów renomowanych producentów. Nasz internetowy sklep z artykułami biurowymi powstał jako odpowiedź na stale rosnące zapotrzebowanie zarówno wśród firm jak również osób prywatnych. Posiadamy wieloletnie doświadczenie w branży artykułów biurowych, szkolnych oraz papierniczych. Na bazie tego doświadczenia przygotowaliśmy dla Państwa nasz internetowy sklep. Zależy nam abyście razem z nami mogli szybko, wygodnie oraz tanio wyposażyć swoje biuro lub w dom we wszelkiego rodzaju akcesoria biurowe. Zachęcamy do zakupów w naszym sklepie, a jeżeli masz jakiekolwiek pytania dotyczące naszej oferty i chcesz dowiedzieć się jakie konkretnie produkty okażą się najlepsze dla Twoich potrzeb skontaktuj się z nami. Pomożemy, doradzimy i na pewno rozwiążemy Twój problem. Sklep internetowy z artykułami papierniczymi, szkolnymi i biurowymi – Atakto.pl – to szeroki i zróżnicowany asortyment, jedno zamówienie, jeden przelew i gwarancja szybkiej dostawy.</div></div></div></div><div class="navbar-default navbar-bottom" id="footer"><div class="container"><div class="navbar-header"><span class="navbar-brand">Newsletter</span><div class="navbar-desc">Zapisz się na newsletter i odbierz <span>rabat 30 zł</span> <br/>przy zakupach powyżej 250zł!</div></div><div class="" id="bottom-menu"><form action="#" id="newsletter" class="navbar-form navbar-left newsletterForm" role="newsletter" method="POST"><div class="form-group inputBox"><input type="text" class="newsletterInput vEmpty vEmail" title="Prosimy podać poprawny e-mail" placeholder="Twój adres email ..." value="" name="mailingSubscribeEmail"></div><button type="submit" class="newsletterSubmit">Wyślij</button><input type="hidden" name="formIdentify" id="formIdentifyController_Mailing_Subscribe" value="Controller_Mailing_Subscribe"></form><ul class="nav navbar-nav navbar-right social"><li class="facebook"><a href="https://www.facebook.com/AtaktoPL" target="_blank">facebook</a></li><li class="google"><a href="https://plus.google.com/108482962641788389170" rel="publisher" target="_blank"> google plus</a></li></ul></div></div></div><div class="pageBottom"><div class="container"><div class="bottomLinksWrap"><div class="col-xs-6"><div class="footerLinks clearfix"><div class="title"> O nas</div><div class="linksCol"><ul><li><a href="/dlaczego-atakto-a">Dlaczego ATAKTO.pl?</a></li><li><a href="/regulamin-a">Regulamin</a></li><li><a href="/club_atacto_foot-a">KLUB ATAKTO</a></li></ul></div><div class="linksCol"><ul><li><a href="/promo_sets-a">Zestawy promocyjne</a></li><li><a href="/leitz-marka-ktora-daje-ci-wybor-a">Leitz - marka, która daje Ci wybór</a></li><li><a href="/rapid-a">Pro